import React, { Component } from 'react';
//import logo from './logo.svg';
import './CardBodyText.css';

class CardBodyText extends Component {
  render() {
    return (
      <div className="CardBodyText">
         This is the CardBodyText
      </div>
    );
  }
}

export default CardBodyText;
